import "./App.scss";
import { Route, Switch } from "react-router-dom";
import { Provider } from "react-redux";
import { store } from "./redux/store";

import Home from "./pages";
import RentalPage from "./pages/rental/rental.component";

const App = () => {
  return (
    <div>
      <Provider store={store}>
        <Router>
          <Home />
        </Router>
      </Provider>
    </div>
  );
};

export default App;
